import './App.css';
import * as React from "react";
import {Admin, Resource} from 'react-admin';
import {Provider} from './provider';

import {
    TournamentList,
    TournamentEdit,
} from './pages/Tournaments';
import {
    SeasonList,
} from './pages/Seasons';


const App = () => {
    return (
        <Admin dataProvider={Provider()}>
            <Resource name="tournaments" list={TournamentList} edit={TournamentEdit}/>
            <Resource name="seasons" list={SeasonList}/>
        </Admin>
    );
};

export default App;
